The effect of climate change on the study area was investigated for the 1% AEP design and PMF events. The following scenarios were modelled:
- 1% AEP design storm event plus 0.9 m sea level rise;
-  1% AEP design storm event with a 10% increase in rainfall plus 0.9 m sea level rise;
-  1% AEP design storm event with a 30% increase in rainfall plus 0.9 m sea level rise;
-  PMF storm event plus 0.9 m sea level rise;
- PMF storm event with a 10% increase in rainfall plus 0.9 m sea level rise;
- PMF storm event with a 30% increase in rainfall plus 0.9 m sea level rise.
Depth and velocity mapping for both the 1% AEP and PMF events with a 30% increase in rainfall plus 0.9 m sea level rise are included as Figure D1 to Figure D4.

Vicmap Transport represents the transport network of the state of Victoria and is made up of point, line and polygon area features in a seamless and topologically structured data set.  It is comprised of a basic framework of linear features supplemented by related point and node and polygon features providing the supplementary data supporting the transport network over the topographic and demographic landscape.  Further classification and description of real world features is provided by attribute tables, which add specific description and definition to each feature supported by code lists that can be used for analysis and individual identification.
The following transport features are fundamental to this data set series:
- Road network - freeway, highway, arterial, 2wd, 4wd,  bicycle and walking tracks.
- Road related structures - including fords, bridges, tunnels, gates, intersections, roundabouts, barriers, rail crossings;
- Ferry routes;
- Rail network, railway yard, tramway, railway bridge, railway tunnel;
- Rail related structures - including railway sidings, stations, railway bridges, railway tunnels;
- Tramway network;
- Air related structures - including (major) airport extents, runways, landing strips, helipads

Vicmap Transport is a combination of a number of data sets that are a part of the Vicmap suite of products.
Datasets in the series are listed below.  See their metadata entries for more detailed metadata.
- Airport Area (polygon) - Vicmap Transport (TR_AIRPORT_AREA_POLYGON);
- Airport Infrastructure - Vicmap Transport (TR_AIRPORT_INFRASTRUCTURE);
- Airport Infrastucture Area (polygon) - Vicmap Transport (TR_AIR_INFRA_AREA_POLYGON);
- Airport Infrastucture Point - Vicmap Transport (TR_AIR_INFRA_POINT); 
- Rail Network - Vicmap Transport (TR_RAIL); 
- Rail Infrastructure - Vicmap Transport (TR_RAIL_INFRASTRUCTURE); 
- Road Network - Vicmap Transport (TR_ROAD); 
- Road Infrastructure - Vicmap Transport (TR_ROAD_INFRASTRUCTURE);
- Road Locality (grouped by road name, road type,road suffix and locality) (TR_ROAD_REGISTER)

This layer provides the boundaries of the Groundwater Catchments of Victoria and is a product of the NWC funded Secure Allocations, Future Entitlement (SAFE) Project. The Groundwater Catchments (GC) have been developed to provide complete coverage of Victoria while considering the following:

(1) Reflect aquifer systems and groundwater movement; and,

(2) Align with physical (i.e. surface water) and administrative boundaries where appropriate.

The GCs are aligned within Victoria’s Groundwater Basins (GB). Boundaries that related directly or in-directly to the physical characteristics of groundwater resources included groundwater flow divides, surface water flow divides, topographic divides, and geological structural features that influence aquifer extent and groundwater flow direction.

Administrative boundaries directly linked to the management of groundwater resources include:

The Victorian State Boundary (Water Act (1989);

WSPA: Water Supply Protection Area (formally declared under provisions of the Act);

GMA: Groundwater Management Area (described and lodged as a plan with the Central Plan Office);

RWC: Rural Water Corporation administration areas - Grampians Wimmera Mallee Water (GWMWater), Goulburn Murray Water (GMW), Lower Murray Water (LMW) and Southern Rural Water (SRW); and

MDBA: Murray Darling Basin Authority (Federal Water Act (2007)).

The description of water resource management is often described in terms of surface water and groundwater.  In reality, the two resources are connected; however there are differing degrees of interconnection depending on the groundwater system and location within the surface water catchment. In preparing the Groundwater Catchments (GC), surface water catchments were directly considered. The key surface water boundaries considered are:

Victorian Sustainable Diversion Limits (SDL) Catchment boundaries;
Bureau of Meteorology (2011) Surface Water Basins (Australian Hydrological Geospatial Framework, product suite v2 2011);
Victorian Surface Water Basin Catchment (Australia’s River Basin, 1997); and,
Geoscience Australia (500 sqkm) National Nested Catchment.

The Rental Report time series dataset provides detailed time-series statistics for some key Rental Report data from the March quarter of 2000 to the December quarter of 2017. This specific dataset presents statistics on affordable 4 bedroom rental properties by the 2016 Local Government Areas geographic level.
Affordable rental properties are those within 30 per cent of gross income for low-income households. The rental thresholds are taken from the household incomes for whom that number of bedrooms is a minimum: 


For one-bedroom properties, we have taken the income of singles on Newstart allowance;


For two-bedroom properties, we have taken a single parent pensioner with one child aged under 5;


For three-bedroom properties, we have taken a couple on Newstart with two children;


For four-bedroom properties, we have taken a couple on Newstart with four children.


The Rental Report provides the most accurate information on the private rental market in Victoria. The data come from records kept by the Residential Tenancies Bond Authority (RTBA). The RTBA is responsible for receiving, registering and refunding all bonds associated with private residential leases in Victoria.
